import React, { useState, useEffect } from "react";
import axios from "axios";
import { Table } from "react-bootstrap";
import StudentTableRow from "./StudentTableRow";

const KsiazkiLista = () => {
  const [ksiazki, setKsiazki] = useState([]);

  useEffect(() => {
    axios
      .get(
        "https://wolnelektury.pl/api/authors/adam-mickiewicz/kinds/liryka/parent_books/"
      )
      .then(({ data }) => {
        setKsiazki(data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);

  const DataTable = () => {
    return ksiazki.map((res, i) => {
      return <StudentTableRow obj={res} key={i} />;
    });
  };

  const pokazKsiazki = () => {
    return ksiazki.map((ksiazki) => {
      return ksiazki.kind;
    });
  };

  const ksiazkiall = pokazKsiazki();

  console.log(ksiazkiall);
  return (
    <div className="table-wrapper">
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>Gatunek</th>
            <th>Email</th>
            <th>Roll No</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {this.state.data.map((item, index) => (
            <tr key={index}>
              <td>{item.column1}</td>
              <td>{item.column2}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
};

export default KsiazkiLista;
